//年 31536000
//月 2592000
//周 604800
//日 86400
//时 3600
//分 60
//秒 1


function timeBetween(timeStamp1,timeStamp2) {
    var between = timeStamp2-timeStamp1;
    var timeStr = "";
    if( between >= 31536000 ){
        timeStr = Math.round(between/31536000) + "年";
    }else if( between < 31536000 && between >= 2592000 ){
        timeStr = Math.round(between/2592000) + "个月";
    }else if( between < 2592000 && between >= 604800 ){
        timeStr = Math.round(between/604800) + "周";
    }else if( between < 604800 && between >= 86400 ){
        timeStr = Math.round(between/86400) + "天";
    }else if( between < 86400 && between >= 3600 ){
        timeStr = Math.round(between/3600) + "小时";
    }else if( between < 3600 && between >= 60 ){
        timeStr = Math.round(between/60) + "分钟";
    }else if( between < 60  ){
        timeStr = "一分钟以内";
    }
    return timeStr;
}



