function timeDetails(timeStamp1,timeStamp2) {

    var between = timeStamp2-timeStamp1;

    var newDate1 = new Date();
    newDate1.setTime((timeStamp1+28800) * 1000);
    var DateStr1 = dateTrans2(newDate1.toISOString());

    var newDate2 = new Date();
    newDate2.setTime((timeStamp2+28800) * 1000);
    var DateStr2 = dateTrans2(newDate2.toISOString());

    var timeStr = "";
    if( between >= 31536000 ){
        timeStr = DateStr1.substring(0,10) + " —— " + DateStr2.substring(0,10) ;
    }else if( between < 31536000 && between >= 86400 ){
        if( DateStr1.charAt(3) != DateStr2.charAt(3)){
            timeStr = DateStr1.substring(0,16) + " —— " + DateStr2.substring(0,16) ;
        }else if( DateStr1.charAt(3) == DateStr2.charAt(3) ){
            timeStr = DateStr1.substring(0,19) + " —— " + DateStr2.substring(5,19) ;
        }else{
            timeStr = DateStr1.substring(0,16) + " —— " + DateStr2.substring(0,16) ;
        }
    }else if( between < 86400 && between >= 3600 ){
        if( DateStr1.charAt(9) != DateStr2.charAt(9)){
            timeStr = DateStr1.substring(0,19) + " —— " + DateStr2.substring(5,19);
        }else if( DateStr1.charAt(9) == DateStr2.charAt(9) ){
            timeStr = DateStr1.substring(0,19) + " —— " + DateStr2.substring(11,19);
        }else{
            timeStr = DateStr1.substring(0,19) + " —— " + DateStr2.substring(5,19);
        }
    }else if( between < 3600 && between >= 60 ){
        timeStr = DateStr1.substring(0,19) + " —— " + DateStr2.substring(11,19);
    }else if( between < 60  ){
        timeStr = DateStr1.substring(0,19) + " —— 最新发布";
    }
    return timeStr;
}



