//获取当前时间的前几天的年，月(英文)，日，星期
function GetDateStr(AddDayCount) {
    var dd = new Date();
    dd.setDate(dd.getDate() + AddDayCount);//获取AddDayCount天后的日期
    var y = dd.getFullYear();
    var m = dd.getMonth() + 1;//获取当前月份的日期
    var mEnglish = new Array("Jan.", "Feb.", "Mar.", "Apr.", "May.", "Jun.", "Jul.", "Aug.", "Sep.", "Oct.", "Nov.", "Dec.");
    mEnglish = mEnglish[m - 1];
    var d = dd.getDate();
    var week = "天一二三四五六".charAt(dd.getDay());
    HPushDate[0] = y;
    HPushDate[1] = mEnglish;
    if (d > 9) {
        HPushDate[2] = d;
    }
    else {
        HPushDate[2] = "0" + d;
    }
    HPushDate[3] = week;
    HPushDate[4] = m;
}
