function GetSameMoth(fstDate, SndDate) {
    var fstYear = fstDate.substring(0, fstDate.indexOf("/"));
    var fstMoth = fstDate.substring(fstDate.indexOf("/") + 1, (fstDate.length));
    fstMoth = fstMoth.substring(0, fstMoth.indexOf("/"));
    var SndYear = SndDate.substring(0, SndDate.indexOf("/"));
    var SndMoth = SndDate.substring(SndDate.indexOf("/") + 1, (SndDate.length));
    SndMoth = SndMoth.substring(0, SndMoth.indexOf("/"));
    if (fstYear == SndYear && fstMoth == SndMoth) {
        return true;
    }
    else {
        return false;
    }
}
