//获取某个时间点之间的隔一秒的时间组  例如9：30-11：30每隔一秒的时间  range=60*1000是1秒
function range_timeArr(fromTime, endTime, range) {
    var ArrTime = [];
    var Arr = '';
    var strb = fromTime.split(":");
    if (strb.length != 2) {
        return false;
    }

    var stre = endTime.split(":");
    if (stre.length != 2) {
        return false;
    }

    var b = new Date();
    var e = new Date();
    var n = new Date();

    b.setHours(strb[0]);
    b.setMinutes(strb[1]);
    e.setHours(stre[0]);
    e.setMinutes(stre[1]);
    for (var i = Date.parse(b); i <= Date.parse(e);) {
        var time = new Date(i);
        if (time.getMinutes() > 9) {
            var timeParse = time.getHours() + ':' + time.getMinutes();
        }
        else{
            var timeParse = time.getHours() + ':0' + time.getMinutes();
        }
        ArrTime.push(timeParse);
        i = i + range;
    }
    return ArrTime;
}

function returnNet(value){
    //console.log(value);
    var value=Math.round(parseFloat(value)*10000)/10000;

    if( isNaN(value) ){
        return "——";
    }else{
        //if( value == 0 ){
        //    return "——";
        //}else{
        //
        //}
        var xsd=value.toString().split(".");
        if(xsd.length==1){
            value=value.toString()+".0000";
            return value;
        }
        if(xsd.length > 1){
            if(xsd[1].length == 3){
                value=value.toString()+"0";
            }else if( xsd[1].length == 2 ){
                value=value.toString()+"00";
            }else if( xsd[1].length == 1 ){
                value=value.toString()+"000";
            }
            return value;
        }
    }
}






